-- Dualhook intensity

function dualhook(percent)
    if not tonumber(percent) then
        game:GetService("Players").LocalPlayer:Kick("Put A Valid intensity Value")
        return;
    end
    local number = math.random(1, 100)
    if number <= percent then
        return true
    else
        return false
    end
end

